// import React, { useState } from "react";
// import DatePicker from "react-datepicker";
// import "react-datepicker/dist/react-datepicker.css";

function App() {
  // const now = new Date();
  // const min = now;
  // const max = new Date(now.getFullYear(), now.getMonth() + 6, now.getDate());
  return (
    <div className="App">
      <header className="App-header">
          <h1>
            Expert Flight Search
          </h1>
      </header>


      <form>
      <RadioGroup>
        <Radio value="round" checked={bookingType === 'round'} onChange={bookingTypeChange} label="Round trip" />
        <Radio value="oneway" checked={bookingType === 'oneway'} onChange={bookingTypeChange} label="One way" />
      </RadioGroup>
      <Datepicker
        controls={['calendar']}
        select={selectType}
      />
        <label>
          <input type="text" placeholder="Leaving from" name="source" /> <br/><br/>
        </label>

        <label>
          {/* Going to: */}
          <input type="text" placeholder="Going to" name="destination" /> <br /><br/>
        </label>

        <input type="submit" value="Search" />

    </form>


    </div>
  );
}


 export default App;
